import styled from 'styled-components';

const Styles = styled.div`
    .color
        background: rgb(11,156,219);
        background: linear-gradient(162deg, rgba(11,156,219,1) 0%, rgba(128,219,120,1) 100%);
        height:200px;   
    }
`;

export const JumboColorSplash = () => (
    <Styles>
        <div class = "color">

        </div>
    </Styles>
)
